import React , {useState} from 'react'

function Counter() {

    const [count , setcount ] = useState(0)

    return (
        <div>
            <h1> {count} </h1>
            <h2 onClick={() => setcount(count+1) } >  PLUS </h2>
            <h2 onClick={() => setcount(count-1) } >  PLUS </h2>
        </div>
    )
}

export default Counter
